IfcClothoid.description:
A clothoid is a planar curve in the form of a spiral. This curve has the property that the curvature varies linearly with the arc length.
{ .extDef}
> NOTE Definition according to ISO 10303-42:2003

IfcColourRgb.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-46:1992
> A colour rgb as a subtype of colour specifications is defined by three colour component values for red, green, and blue in the RGB colour model.

IfcColourSpecification.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-46:1992
> The colour specification entity contains a direct colour definition. Colour component values refer directly to a specific colour space.

IfcConnectedFaceSet.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-42:1992
> A connected_face_set is a set of faces such that the domain of faces together with their bounding edges and vertices is connected.

IfcContextDependentUnit.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-41:1992
> A context dependent unit is a unit which is not related to the SI system.

IfcCurveStyleFont.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-46:1992
> A curve style font combines several curve style font pattern entities into a more complex pattern. The resulting pattern is repeated along the curve.

IfcCurveStyleFontPattern.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-46:1992
> A curve style font pattern is a pair of visible and invisible curve segment length measures in presentation area units.

IfcDerivedUnitElement.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-41:1992
> A derived unit element is one of the unit quantities which makes up a derived unit.

IfcDimensionalExponents.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-41:1992
> The dimensionality of any quantity can be expressed as a product of powers of the dimensions of base quantities. The dimensional exponents entity defines the powers of the dimensions of the base quantities. All the physical quantities are founded on seven base quantities (ISO 31 (clause 2)).

IfcEdgeLoop.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-42:1992
> An edge_loop is a loop with nonzero extent. It is a path in which the start and end vertices are the same. Its domain, if present, is a closed curve. An edge_loop may overlap itself.

IfcExternallyDefinedHatchStyle.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-46:1992
> The externally defined hatch style is an entity which makes an external reference to a hatching style.

IfcExternallyDefinedTextFont.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-46:1992
> The externally defined text font is an external reference to a text font

IfcFaceBound.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-42:1992
> A face bound is a loop which is intended to be used for bounding a face.

IfcFaceOuterBound.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-42:1992
> A face outer bound is a special subtype of face bound which carries the additional semantics of defining an outer boundary on the face. No more than one boundary of a face shall be of this type.

IfcLightSource.description:
{ .extDef}
> NOTE  Definition according to ISO 10303-46:
> The light source entity is determined by the reflectance specified in the surface style rendering. Lighting is applied on a surface by surface basis: no interactions between surfaces such as shadows or reflections are defined.

IfcLightSourceAmbient.description:
{ .extDef}
> NOTE  Definition according to ISO 10303-46:
> The light source ambient entity is a subtype of light source. It lights a surface independent of the surface's orientation and position.

IfcLightSourceDirectional.description:
{ .extDef}
> NOTE  Definition according to ISO 10303-46:
> The light source directional is a subtype of light source. This entity has a light source direction. With a conceptual origin at infinity, all the rays of the light are parallel to this direction. This kind of light source lights a surface based on the surface's orientation, but not position.

IfcLightSourcePositional.description:
{ .extDef}
> NOTE  Definition according to ISO 10303-46:
> The light source positional entity is a subtype of light source. This entity has a light source position and attenuation coefficients. A positional light source affects a surface based on the surface's orientation and position.

IfcLightSourceSpot.description:
{ .extDef}
> NOTE  Definition according to ISO 10303-46:
> The light source spot entity is a subtype of light source. Spot light source entities have a light source colour, position, direction, attenuation coefficients, concentration exponent, and spread angle. If a point lies outside the cone of influence of a light source of this type as determined by the light source position, direction and spread angle its colour is not affected by that light source.

IfcMeasureWithUnit.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-41:1992
> A measure with unit is the specification of a physical quantity as defined in ISO 31 (clause 2).

IfcNamedUnit.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-41:1992
> A named unit is a unit quantity associated with the word, or group of words, by which the unit is identified.

IfcPreDefinedCurveFont.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-46:1992
> The predefined curve font type is an abstract supertype provided to define an application specific curve font. The name label shall be constrained in the application protocol to values that are given specific meaning for curve fonts in that application protocol.

IfcSubedge.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-42:1992
> A subedge is an edge whose domain is a connected portion of the domain of an existing edge. The topological constraints on a subedge are the same as those on an edge.

IfcTextStyleFontModel.description:
{ .extDef}
> Definition according to W3C for Cascading Style Sheets:
> Setting font properties will be among the most common uses of style sheets. Unfortunately, there exists no well-defined and universally accepted taxonomy for classifying fonts, and terms that apply to one font family may not be appropriate for others. For example, 'italic' is commonly used to label slanted text, but slanted text may also be labeled as being Oblique, Slanted, Incline, Cursive or Kursiv. Therefore it is not a simple problem to map typical font selection properties to a specific font.

IfcTopologicalRepresentationItem.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-42:1992
> The topological representation item is the supertype for all the topological representation items in the geometry resource.

IfcVertex.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-42:1992
> A vertex is the topological construct corresponding to a point. It has dimensionality 0 and extent 0. The domain of a vertex, if present, is a point in m dimensional real space _R^M^_; this is represented by the vertex point subtype.

IfcVertexPoint.description:
{ .extDef}
> NOTE  Definition according to ISO/CD 10303-42:1992
> A vertex point is a vertex which has its geometry defined as a point.
